import React, { Component } from 'react'
import SideBar from '../components/sidebar';
import Navbar from '../components/Navbar/index';
import Home from '../components/Home/index';

export class home extends Component {
  render() {
    return (
        <div id="App">
            <Navbar />
            <SideBar />
            <div id="page-wrap">
                <Home />
            </div>
        </div>
    )
  }
}

export default home
